import { Avatar, Box, Button, Checkbox, FormControlLabel, Grid, TextField, Typography } from "@material-ui/core";
import React, { useEffect } from "react";
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import { LOGIN } from "../../../api"; 
import {useFormik} from 'formik'
import useStyle from "./SignIn.style";
//for fetch data use useEffect babe
const SignIn =()=>{
    const classes = useStyle();
    const handleSubmitForm= ()=>{
        console.log('submited');
    };
    const handleChange = (e)=>{
  
    }

     const formik = useFormik({
        initialValues:{
            fullname : 'fullname',
            username:'',
            email:'',
            password:'',
            confirmpassword:'',
      },
      onSubmit: handleSubmitForm,
      onChange: handleChange,
     },
    
     );

    return (
        <Box
        className={classes.root}
      >
        <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
          <LockOutlinedIcon />
        </Avatar>
        <Typography component="h1" variant="h5">
          Sign in
        </Typography>
        <Box component='form' onSubmit={formik.handleSubmit }  sx={{ mt: 1 }}>
          <TextField
            margin="normal"
            required
            fullWidth
            id="fullName"
            label="Full Name"
            name="fullname"
            autoComplete="input"
            autoFocus
            value={formik.values.fullname}
            onChange={formik.handleChange}
          />
          <TextField
            margin="normal"
            required
            fullWidth
            id="username"
            label="UserName"
            name="username"
            autoComplete="input"
            autoFocus
            value={formik.values.username}
            onChange={formik.handleChange}
          />
          <TextField
            margin="normal"
            required
            fullWidth
            id="email"
            label="Email Address"
            name="email"
            autoComplete="email"
            autoFocus
            value={formik.values.email}
            onChange={formik.h}
          />
          <TextField
            margin="normal"
            required
            fullWidth
            name="password"
            label="Password"
            type="password"
            id="password"
            autoComplete="current-password"
            value={formik.values.password}
            onChange={formik.onChange}
          />
          <TextField
            margin="normal"
            required
            fullWidth
            name="confirmpassword"
            label="Password"
            type="password"
            id="confirmassword"
            autoComplete="current-password"
            value={formik.values.confirmpassword}
            onChange={formik.onChange}
          
          />
          <FormControlLabel
            control={<Checkbox value="remember" color="primary" />}
            label="Remember me"
          />
          <Button
            type="submit"
            fullWidth
            variant="contained"
            sx={{ mt: 3, mb: 2 }}
          >
            Sign In
          </Button>
        </Box>
      </Box> 
    )
};

export default SignIn;
